import Navbar from "../components/Navbar"


export default function About() {
  return (
    <div>
      <Navbar/>
      <div className="about">      
        <h2 className="quote architects-daughter-regular">“There is no greater agony than bearing an untold story inside you.”</h2>
        <h3 className="author playwrite-is-italics">- Maya Angelou</h3>
      </div>
    </div>
  )
}
